import React, { useState } from 'react';
import { Container, Card } from './styles';
import Register from '../Register';
import Login from '../Login';
import { Button } from '@material-ui/core';

const Layout = ( ) => {
	const [ state, setState ] = useState('register');
return (
	<Container>
		<h1>InstaCar</h1>
		{ state === 'register' ? (
			<Card>
				<Register />
				<br />
				<p>Already a User? <Button color="primary"  onClick={() => setState('login')}>Login</Button></p>
			</Card>
		): (
			<Card>
				<Login />
				<p>Register for fist time<Button color="primary"  onClick={() => setState('register')}>Register</Button></p>
			</Card>
		)}
	</Container>
  );
};
export default Layout ;
